import React from 'react';
import './PaymentCancellation.css'; // Import the CSS file

const PaymentCancellation = () => {
  return (
    <div className="payment_cancellation">
      <h2>Payment Cancellation</h2>
      <p>Your payment has been cancelled. If you have any issues, please contact customer support.</p>
    </div>
  );
};

export default PaymentCancellation;
